// src/pages/admin/AddLecture.jsx
import React, { useState, useEffect } from "react";
import axios from "axios";
import AdminNavbar from "../../components/AdminNavbar";

const AddLecture = () => {
  const [title, setTitle] = useState("");
  const [courseId, setCourseId] = useState("");
  const [instructorId, setInstructorId] = useState("");
  const [courses, setCourses] = useState([]);
  const [instructors, setInstructors] = useState([]);
  const [message, setMessage] = useState("");
  const [loading, setLoading] = useState(true);
  const [submitting, setSubmitting] = useState(false);

  // Fetch courses & instructors
  useEffect(() => {
    const fetchData = async () => {
      setLoading(true);
      try {
        const token = localStorage.getItem("adminToken");
        if (!token) throw new Error("No token found. Please login.");

        const [coursesRes, instructorsRes] = await Promise.all([
          axios.get("http://localhost:5000/api/admin/courses", {
            headers: { Authorization: `Bearer ${token}` },
          }),
          axios.get("http://localhost:5000/api/admin/instructors", {
            headers: { Authorization: `Bearer ${token}` },
          }),
        ]);

        setCourses(
          Array.isArray(coursesRes.data)
            ? coursesRes.data
            : coursesRes.data.courses || []
        );
        setInstructors(
          Array.isArray(instructorsRes.data)
            ? instructorsRes.data
            : instructorsRes.data.instructors || []
        );
      } catch (err) {
        console.error(err);
        setMessage(
          err.response?.data?.message || err.message || "Failed to load data"
        );
      } finally {
        setLoading(false);
      }
    };

    fetchData();
  }, []);

  const handleSubmit = async (e) => {
    e.preventDefault();
    setSubmitting(true);
    setMessage("");

    try {
      const token = localStorage.getItem("adminToken");
      if (!token) throw new Error("No token found. Please login.");

      const res = await axios.post(
        "http://localhost:5000/api/admin/lecture",
        { title, courseId, instructorId },
        { headers: { Authorization: `Bearer ${token}` } }
      );

      setMessage(res.data.message || "Lecture added successfully!");
      setTitle("");
      setCourseId("");
      setInstructorId("");
    } catch (err) {
      setMessage(
        err.response?.data?.message || err.message || "Failed to add lecture"
      );
    } finally {
      setSubmitting(false);
    }
  };

  if (loading) return <Loader />;

  return (
    <div className="min-h-screen bg-gray-100">
      <AdminNavbar />
      <div className="max-w-md mx-auto p-6 bg-white rounded shadow mt-6">
        <h2 className="text-2xl font-bold mb-4">Add Lecture</h2>
        {message && (
          <div className="mb-4 p-2 bg-blue-200 text-blue-800 rounded">
            {message}
          </div>
        )}
        <form onSubmit={handleSubmit} className="space-y-4">
          <input
            placeholder="Lecture Title"
            value={title}
            onChange={(e) => setTitle(e.target.value)}
            required
            className="w-full p-2 border rounded"
          />
          <select
            value={courseId}
            onChange={(e) => setCourseId(e.target.value)}
            required
            className="w-full p-2 border rounded"
          >
            <option value="">Select Course</option>
            {courses.map((c) => (
              <option key={c._id || c.id} value={c._id || c.id}>
                {c.name}
              </option>
            ))}
          </select>
          <select
            value={instructorId}
            onChange={(e) => setInstructorId(e.target.value)}
            required
            className="w-full p-2 border rounded"
          >
            <option value="">Select Instructor</option>
            {instructors.map((i) => (
              <option key={i._id || i.id} value={i._id || i.id}>
                {i.name}
              </option>
            ))}
          </select>
          <button
            type="submit"
            disabled={submitting}
            className="w-full bg-green-600 text-white py-2 rounded hover:bg-green-700"
          >
            {submitting ? "Adding..." : "Add Lecture"}
          </button>
        </form>
      </div>
    </div>
  );
};

export default AddLecture;
